import (
	"fmt"
	"time"

	"go.uber.org/zap"
)

type relayState string

// Relay data signals.
const (
	MainRelayStateOpen   relayState = "open"
	MainRelayStateClosed relayState = "closed"
)

// MeasureTripTime measures the duration it takes for the main relay to open/close by reading the verivolt
// grid and inverter voltage measurements, and stopping the trip timer when the logic condition is met.
// To properly use this function, call it immediately after triggering the grid fault event.
func MeasureTripTime(rs relayState, logger *zap.Logger,
	loopDuration time.Duration) (time.Duration, error) {
	logger.Info("measuring_time_it_takes_the_main_relay_to_trip")

	tripTimerStart := time.Now()

	const (
		relayTripTolerancePu float64 = 0.0005 // 0.05% tolerance for now.
	)

	var (
		gridVoltageData map[string]float64
		gridVoltageL1   float64
		gridVoltageL2   float64
		invVoltageData  map[string]float64
		invVoltageL1    float64
		invVoltageL2    float64
		tripTime        time.Duration
		err             error
	)

	gridSignals := []string{
		VvGridL1SignalVolts, // verivolt grid L1-N voltage.
		VvGridL2SignalVolts, // verivolt grid L2-N voltage.
	}

	inverterSignals := []string{
		VvInvL1SignalVolts, // verivolt inverter L1 Voltage.
		VvInvL2SignalVolts, // verivolt inverter L2 Voltage.
	}

	relayTransitionObserved := false

	logger.Info(fmt.Sprintf("measuring_time_it_takes_the_main_relay_to_trip_%s", rs))
	for time.Since(tripTimerStart) < loopDuration {
		gridVoltageData, err = ReadSignal(gridSignals, ReadSignalDuration, logger)
		if err != nil {
			logger.Error("failed_to_read_signal", zap.Error(err))
			return 0, fmt.Errorf("failed_to_read_signal")
		}
		gridVoltageL1 = gridVoltageData[VvGridL1SignalVolts]
		gridVoltageL2 = gridVoltageData[VvGridL2SignalVolts]

		deltaGridL1 := gridVoltageL1 * relayTripTolerancePu
		deltaGridL2 := gridVoltageL2 * relayTripTolerancePu

		invVoltageData, err = ReadSignal(inverterSignals, ReadSignalDuration, logger)
		if err != nil {
			logger.Error("failed_to_read_signal", zap.Error(err))
			return 0, fmt.Errorf("failed_to_read_signal")
		}
		invVoltageL1 = invVoltageData[VvInvL1SignalVolts]
		invVoltageL2 = invVoltageData[VvInvL2SignalVolts]

		if relayTransitioned(rs, invVoltageL1, invVoltageL2,
			gridVoltageL1, gridVoltageL2, deltaGridL1, deltaGridL2) {
			relayTransitionObserved = true
			logger.Info(fmt.Sprintf("%s_relay_condition_met", rs))
			break
		}
		time.Sleep(BusyWaitingDelay)
	}
	tripTime = time.Since(tripTimerStart)
	logger.Info(fmt.Sprintf("time_taken_to_meet_%s_relay_recondition", rs), zap.Duration("trip_time", tripTime))

	// Return if the condition is not met within loopDuration.
	if !relayTransitionObserved {
		return 0, fmt.Errorf("relay_condition_not_met_within_allowed_duration")
	}

	return tripTime, nil
}

func relayTransitioned(
	rs relayState,
	invVoltageL1,
	invVoltageL2,
	gridVoltageL1,
	gridVoltageL2,
	deltaGridL1 float64,
	deltaGridL2 float64,
) bool {
	result := false
	if (rs == MainRelayStateOpen &&
		invVoltageL1 > gridVoltageL1+deltaGridL1 ||
		invVoltageL1 < gridVoltageL1-deltaGridL1 ||
		invVoltageL2 > gridVoltageL2+deltaGridL2 ||
		invVoltageL2 < gridVoltageL2-deltaGridL2) ||
		(rs == MainRelayStateClosed &&
			invVoltageL1 < gridVoltageL1+deltaGridL1 &&
			invVoltageL1 > gridVoltageL1-deltaGridL1 &&
			invVoltageL2 < gridVoltageL2+deltaGridL2 &&
			invVoltageL2 > gridVoltageL2-deltaGridL2) {
		result = true
	}
	return result
}
